import React from 'react';
import styled from 'styled-components';
import {Search} from '@material-ui/icons';

const Container = styled.div`
   background-color:whitesmoke;
   padding:20px;
`;

const Wrapper = styled.div`
    display:flex;
    justify-content:space-between;
    align-items:center;
`;

const SearchContainer = styled.div` 
    position:relative;
    margin-left:10px;
    background-color:white;
    padding:10px;
    display:flex;
    align-items:center;
    border-radius:4px;
`;

const Left = styled.div`
    display:flex;
    justify-content:center;
    align-items:center;
    flex:1;
`;

const Center = styled.div`
    flex:1;
`;

const Right = styled.div`
    flex:1;
`;

const Input = styled.input`
    height:100%;
    font-size:1.3rem;
    border:none;
    outline:none;
`;

const Title = styled.h3`
    font-size:1.4rem;
`


const App = () => {
  return (
    <Container>
      <Wrapper>
        <Left>
          <Title>En</Title>
          <SearchContainer>
            <Input/>
            <Search/>
          </SearchContainer>
        </Left>

        <Center>

        </Center>

        <Right>

        </Right>
      </Wrapper>
    </Container>
  )
}

export default App
